import React from "react";
import Filas from "./Filas";
import ProspectoModal from "./ProspectoModal";

const Tabla = (props) => (
  <table className="table table-striped" style={{ width: "100%" }}>
    <thead>
      <tr>
        {props.cabeceras.map((cabecera) => (
          <th>{cabecera}</th>
        ))}
      </tr>
    </thead>
    <tbody>
      {props.prospectos.map((prospecto, index) => (
        <Filas key={prospecto._id} indice={index + 1} prospecto={prospecto} />
      ))}
    </tbody>
    <ProspectoModal />
  </table>
);

export default Tabla;
